measurements.description:
Fifteen flowers and five buds tightly shingled on a 23-cm pendant inflorescence;
	sepals clear light pink faintly speckled rose marginally; elevated and overlapping petals light pink, lighter marginally, uniformly
	speckled dark rose throughout; lip cileate margined, cream, light yellow basally, sparsely speckled rose side-lobes, yellow callus; column pale
yellow;	




    substance hard; texture waxy.
